parts:
{
  "message_name": "UBX-RXM-RAWX",
  "class_id": "0x02",
  "message_id": "0x15",
  "message_type": "periodic_polled",
  "payload_length": {
    "variable": {
      "base": 16,
      "formula": "16 + numMeas * 32"
    }
  },
  "fields": [
    {
      "byte_offset": 0,
      "name": "rcvTow",
      "data_type": "R8",
      "unit": "s",
      "description": "Measurement time of week in receiver local time approximately aligned to the GPS time system."
    },
    {
      "byte_offset": 8,
      "name": "week",
      "data_type": "U2",
      "unit": "weeks",
      "description": "GPS week number in receiver local time."
    },
    {
      "byte_offset": 10,
      "name": "leaps",
      "data_type": "I1",
      "unit": "s",
      "description": "GPS leap seconds (GPS-UTC). This field represents the receiver's best knowledge of the leap seconds offset."
    },
    {
      "byte_offset": 11,
      "name": "numMeas",
      "data_type": "U1",
      "description": "Number of measurements to follow"
    },
    {
      "byte_offset": 12,
      "name": "recStat",
      "data_type": "X1",
      "description": "Receiver tracking status bitfield",
      "fields": [
        {
          "bit_offset": 0,
          "bit_length": 1,
          "name": "leapSec",
          "data_type": "U:1",
          "description": "Leap seconds have been determined"
        },
        {
          "bit_offset": 1,
          "bit_length": 1,
          "name": "clkReset",
          "data_type": "U:1",
          "description": "Clock reset applied. Typically the receiver clock is changed in increments of integer milliseconds."
        }
      ]
    },
    {
      "byte_offset": 13,
      "name": "version",
      "data_type": "U1",
      "fixed_value": 1,
      "description": "Message version (0x01 for this version)"
    },
    {
      "byte_offset": 14,
      "name": "reserved0",
      "data_type": {
        "array_of": "U1",
        "count": 2
      },
      "reserved": true
    },
    {
      "byte_offset": 16,
      "name": "measurements",
      "data_type": "GROUP",
      "count_field": "numMeas",
      "fields": [
        {
          "byte_offset": 0,
          "name": "prMes",
          "data_type": "R8",
          "unit": "m",
          "description": "Pseudorange measurement [m]. GLONASS inter frequency channel delays are compensated with an internal calibration table."
        },
        {
          "byte_offset": 8,
          "name": "cpMes",
          "data_type": "R8",
          "unit": "cycles",
          "description": "Carrier phase measurement [cycles]."
        },
        {
          "byte_offset": 16,
          "name": "doMes",
          "data_type": "R4",
          "unit": "Hz",
          "description": "Doppler measurement (positive sign for approaching satellites) [Hz]"
        },
        {
          "byte_offset": 20,
          "name": "gnssId",
          "data_type": "U1",
          "description": "GNSS identifier (see Satellite Numbering for a list of identifiers)"
        },
        {
          "byte_offset": 21,
          "name": "svId",
          "data_type": "U1",
          "description": "Satellite identifier (see Satellite Numbering)"
        },
        {
          "byte_offset": 22,
          "name": "sigId",
          "data_type": "U1",
          "description": "New style signal identifier (see Signal Identifiers).(not supported for protocol versions less than 27.00)"
        },
        {
          "byte_offset": 23,
          "name": "freqId",
          "data_type": "U1",
          "description": "Only used for GLONASS: This is the frequency slot + 7 (range from 0 to 13)"
        },
        {
          "byte_offset": 24,
          "name": "locktime",
          "data_type": "U2",
          "unit": "ms",
          "description": "Carrier phase locktime counter (maximum 64500ms)"
        },
        {
          "byte_offset": 26,
          "name": "cno",
          "data_type": "U1",
          "unit": "dBHz",
          "description": "Carrier-to-noise density ratio (signal strength) [dB-Hz]"
        },
        {
          "byte_offset": 27,
          "name": "prStdev",
          "data_type": "X1",
          "scale": {
            "raw": "0.01*2^n"
          },
          "unit": "m",
          "description": "Estimated pseudorange measurement standard deviation",
          "fields": [
            {
              "bit_offset": 0,
              "bit_length": 4,
              "name": "prStd",
              "data_type": "U:4",
              "description": "Estimated pseudorange standard deviation"
            }
          ]
        },
        {
          "byte_offset": 28,
          "name": "cpStdev",
          "data_type": "X1",
          "scale": {
            "multiplier": 0.004
          },
          "unit": "cycles",
          "description": "Estimated carrier phase measurement standard deviation (note a raw value of 0x0F indicates the value is invalid)",
          "fields": [
            {
              "bit_offset": 0,
              "bit_length": 4,
              "name": "cpStd",
              "data_type": "U:4",
              "description": "Estimated carrier phase standard deviation"
            }
          ]
        },
        {
          "byte_offset": 29,
          "name": "doStdev",
          "data_type": "X1",
          "scale": {
            "raw": "0.002*2^n"
          },
          "unit": "Hz",
          "description": "Estimated Doppler measurement standard deviation.",
          "fields": [
            {
              "bit_offset": 0,
              "bit_length": 4,
              "name": "doStd",
              "data_type": "U:4",
              "description": "Estimated Doppler standard deviation"
            }
          ]
        },
        {
          "byte_offset": 30,
          "name": "trkStat",
          "data_type": "X1",
          "description": "Tracking status bitfield",
          "fields": [
            {
              "bit_offset": 0,
              "bit_length": 1,
              "name": "prValid",
              "data_type": "U:1",
              "description": "Pseudorange valid"
            },
            {
              "bit_offset": 1,
              "bit_length": 1,
              "name": "cpValid",
              "data_type": "U:1",
              "description": "Carrier phase valid"
            },
            {
              "bit_offset": 2,
              "bit_length": 1,
              "name": "halfCyc",
              "data_type": "U:1",
              "description": "Half cycle valid"
            },
            {
              "bit_offset": 3,
              "bit_length": 1,
              "name": "subHalfCyc",
              "data_type": "U:1",
              "description": "Half cycle subtracted from phase"
            }
          ]
        },
        {
          "byte_offset": 31,
          "name": "reserved1",
          "data_type": "U1",
          "reserved": true
        }
      ]
    }
  ]
}
